INSERT INTO `application` (`id`, `vnum`, `ctstp`, `utstp`, `Style`, `Authenticity`, `Availability`, `Confidentiality`, `Integrity`, `Name`, `Owner`, `CodeNm`, `Alias`, `ShortDesc`, `LongDesc`) VALUES
(1, 2, '2017-01-16 09:10:10', '2017-02-14 11:26:38', 8, 4, 4, 4, 4, 'CCP', NULL, 'AID004', 'IC Integrated Clearer, Eurex CCP', 'The CCP System implements the functions of a "Central Counterpart" and a number of other clearing and settlement related services for the Eurex Clearing House and the Cash Markets . These Services are:', 'The CCP has the function to take-over the settlement risk, provide anonymity conditions after trade execution and reduce the number of securities deliveries through offsetting algorithms(netting). The CCP simplifies the cross-border settlement and enable'),
(2, 2, '2017-01-16 09:10:10', '2017-01-16 23:21:56', 10, 5, 4, 4, 4, 'DWH/PND/PND2', NULL, 'AID005', 'Production Near Database, XPND', 'PND is the datawarehouse for all legacy tading and clearing systems', 'The main purpose of PND is to provide historical data to market and clearing operations and survaillance. Several application use the PND as there back end:'),
(3, 1, '2017-01-16 09:10:10', '2017-01-16 09:10:10', 9, 4, 4, 4, 4, 'EDRE', NULL, 'AID003', '', 'Event Driven Risk Engine for real time calculation of risk exposure for derivates positions. ', 'The EDRE Event Driven Risk Engine does real time calculation of risk exposure for derivates positions (Eurex, ECC and KRX). It is the realtime part of the legacy risk solution and shares the master data with risk engine. EDRE was developed based on Xetra'),
(4, 1, '2017-01-16 09:10:10', '2017-01-16 09:10:10', 8, 4, 4, 4, 4, 'Eurex Classic', NULL, 'AID001', '', 'Eurex Derivatives Clearing System', 'The Eurex classic system is the Eurex legacy infrastructure for derivatives, which is currently beeing replaced by new systems with state-of-the-art architecture. '),
(5, 1, '2017-01-16 09:10:10', '2017-01-16 09:10:10', 10, 4, 4, 4, 4, 'Risk Engine', NULL, 'AID006', '', 'Risk Engine is based on the Legacy VMS architecture. Decommissioning is planned for 2017.', 'The focus of the Risk engine is to calculate end of day margin. However it also calculates intraday margin on a 3 minute basis for the cash market trades (XETRA). The position for the cash market are delivered via CCP. '),
(6, 1, '2017-01-16 09:10:10', '2017-01-16 09:10:10', 9, 5, 5, 4, 5, 'XETRA', NULL, 'AID002', 'Xetra Vienna FFM2, Scoach', 'XETRA is a trading system for cash market, bonds  and warrants. Currently DBAG run several instance of XETRA for:', 'Xetra Functional Model'),
(7, 1, '2017-01-16 09:10:10', '2017-01-16 09:10:10', 9, 4, 4, 4, 4, 'XONTRO', NULL, 'AID007', '', 'XONTRO is an order routing, trading and settlement system. ', 'As an electronic, intermediary-based trading system set up for the German stock exchange floors, XONTRO supports the contraction of trades in all quoted u8211 ? national and international u8211 ? securities. At present, about 30% of all cash market trans'),
(8, 1, '2017-01-16 09:10:10', '2017-01-16 09:10:10', 8, 4, 4, 4, 4, 'C7', NULL, 'AID021', 'CLEAR', 'C7 as the core clearing System is the trade and position management system for listed derivatives. C7 was designed to meet a changing regulatory environment, while at the same time bringing the scalability and flexibility needed to meet evolving product ', 'Key features of the C7 clearing architecture: '),
(9, 1, '2017-01-16 09:10:10', '2017-01-16 09:10:10', 8, 4, 4, 4, 4, 'Calypso', NULL, 'AID020', '', 'Calypso is a clearing platform for OTC derivatives, which was established in 2009 for exotic OTC Products. Its main focus is to provide novation workflow support. ', 'Calypso offers comprehensive account management for clearing client, including: '),
(10, 1, '2017-01-16 09:10:10', '2017-01-16 09:10:10', 8, 4, 4, 4, 4, 'CASCADE', NULL, 'AID022', '', 'CASCADE  (Central Application for Settlement, Clearing and Depository Expansion) ', 'Times New Roman;Century Gothic;Courier New;Arial;Segoe UI;symbol;symbol;Times New Roman;&quot;;wingdings;;;;Normal;Default Paragraph Font;The CASCADE components comprises the following functionality for CSC business :'),
(11, 1, '2017-01-16 09:10:10', '2017-01-16 09:10:10', 9, 5, 5, 5, 5, 'CEF', NULL, 'AID017', '', 'Deutsche B?rseu8217 ?s real-time data feed CEF delivers market data from the Deutsche B?rse markets, e. g. Eurex and Xetra, and those of its cooperation partners. CEF? provides prices, indices and volumes to produce sophisticated information products for', 'CEF is the data stream for information providers, front offices of traders, investment consultants and fund managers. CEF Feed is a high performance, entitlement-driven Feed transmitted via TCP/IP and point-to-point connections. It enables users to recei'),
(12, 1, '2017-01-16 09:10:10', '2017-01-16 09:10:10', 8, 4, 4, 4, 4, 'KUSTA', NULL, 'AID009', '', 'Kusta is the leading system to maintain and provide account master data and member Id''s of type CBF-ID for all CBF systems.', 'Data maintenance is via Host Based GUI access, Data Delivery is GUI, Direct Access and CSV files sent. Kusta will be extended in 2016 for Clearstream Lux related to T2S. '),
(13, 1, '2017-01-16 09:10:10', '2017-01-16 09:10:10', 9, 4, 4, 4, 4, 'Prisma', NULL, 'AID015', '', 'Prisma is an exposure calculation engine based on a portfolio-based risk management approach.', 'Prisma calculates combined risks across all markets cleared by Eurex Clearing. Cleared products that share similar risk characteristics are assigned to the same so-called Liquidation Group, which results in more comprehensive risk calculations enabling c'),
(14, 1, '2017-01-16 09:10:10', '2017-01-16 09:10:10', 10, 4, 4, 4, 4, 'StatistiX', NULL, 'AID019', '', 'StatistiX is the Information factory of Deutsche B?rse Group processing information over the complete value chain and offering Information services to internal and external customers of Deutsche B?rse Group.', 'StatistiX serves also as a platform for several smaller applications leveraging a common data pool and technology.  It serves as a data store for all major applications of the stock exchange business. The reporting engine produces reports both towards th'),
(15, 1, '2017-01-16 09:10:10', '2017-01-16 09:10:10', 9, 4, 4, 4, 4, 'T7', NULL, 'AID011', 'NTA, Eurex & Xetra Trading', 'T7 is a multi exchange trading system, built by Deutsche B?rse.', 'T7 offers a wide range of derivatives & cash trading functionality. It is highly configurable and can be adapted to the needs of the individual markets, on any level, from the entire market down to individual instrument groups. On the technical side, Eur'),
(16, 1, '2017-01-16 09:10:10', '2017-01-16 09:10:10', 10, 5, 5, 5, 5, 'Trice', NULL, 'AID010', '', '  Trice is an application for regulatory reporting according to ?9 WPHG and offered as a service to the members.', 'Trice is an application for regulatory reporting according to  ?9 WPHG.'),
(17, 1, '2017-01-16 09:10:10', '2017-01-16 09:10:10', 8, 4, 4, 6, 4, 'WSS', NULL, 'AID008', 'Wertpapier Service System', 'WSS (Wertpapier Stammdaten System) is central reference data source for securities (master, event and price data) for Deutsche B?rse. ', 'Key product characteristics:'),
(18, 1, '2017-01-16 09:10:10', '2017-01-16 09:10:10', 11, 5, 5, 6, 5, 'XIS', NULL, 'AID018', 'Index Engine', 'XIS  is the index calculation engine of Deutsche B?rse.', 'XIS calculates all indices of the the DAX and derived family. XIS has a versatile architecture in order to accommodate different calculation engines. Some of them with pre-defined calculation algorithms, others are run-time configurable. XIS covers a wid'),
(19, 1, '2017-01-16 09:10:10', '2017-01-16 09:10:10', 8, 4, 4, 4, 4, 'AM', NULL, 'AID031', '', 'Management of account master related reference data', 'The AM platform allows the management of account related reference data for the ICSD business needs.'),
(20, 1, '2017-01-16 09:10:10', '2017-01-16 09:10:10', 8, 5, 5, 5, 5, 'CmaX', NULL, 'AID034', '', 'Triparty collateral management', 'Triparty Collateral Management'),
(21, 1, '2017-01-16 09:10:10', '2017-01-16 09:10:10', 8, 4, 4, 4, 4, 'Custody', NULL, 'AID033', '', 'Custody events lifecycle management (data verification, notification, payments, etc.)', 'Corporate actions processing'),
(22, 1, '2017-01-16 09:10:10', '2017-01-16 09:10:10', 10, 6, 5, 5, 5, 'Dataserver', NULL, 'AID029', '', 'Data collection and consolidation', 'Central Data Store of Clearstream systems'),
(23, 1, '2017-01-16 09:10:10', '2017-01-16 09:10:10', 8, 4, 4, 4, 4, 'HUB', NULL, 'AID035', '', 'Handles routing and transformation to external delivery channels', 'The HUB is responsible to do the connection between the backend systems and the external world.'),
(24, 1, '2017-01-16 09:10:10', '2017-01-16 09:10:10', 8, 4, 4, 4, 4, 'KADI', NULL, 'AID025', '', 'Corporate Actions and Events processing', 'KADI is used to handle corporate actions for all balances held in CBF or Customer vaults in CSC business and on CCP trades. It provides the following functionality :'),
(25, 1, '2017-01-16 09:10:10', '2017-01-16 09:10:10', 10, 5, 6, 4, 5, 'MARS', NULL, 'AID032', '', 'Creation of Reports, Dashboards, KPIs and Scorecard with the MicroStrategy application.', 'MARS Reporting'),
(26, 1, '2017-01-16 09:10:10', '2017-01-16 09:10:10', 8, 4, 4, 6, 4, 'NCS', NULL, 'AID027', '', 'Cleanses, scrubs and aggregates event information received from internal and external sources for subsequent transmission to the Custody system.', 'The Custody system is driven by the input of Corporate Action event notifications. Rather than manually entering these events using a Custody graphical interface, it is more efficient to subscribe to data feeds (external market feeds, depositories, inter'),
(27, 1, '2017-01-16 09:10:10', '2017-01-16 09:10:10', 8, 4, 4, 6, 4, 'RDF', NULL, 'AID030', '', 'RDF is the master for reference data on Security / Institution / Country / City / National Region.', 'Corporate data maintenance / publication / workflow management'),
(28, 1, '2017-01-16 09:10:10', '2017-01-16 09:10:10', 8, 4, 4, 4, 4, 'Report Server', NULL, 'AID028', '', 'Clearstream consolidated and aggregated reporting', 'Report Server is a high-performance reporting system based on a UNIX platform, reusing and extending the existing technologies developed for the RTS/Creation platform. It will utilise both on-line and batch technology.'),
(29, 1, '2017-01-16 09:10:10', '2017-01-16 09:10:10', 8, 6, 5, 5, 4, 'Vestima+', NULL, 'AID026', '', 'Management of Investment funds', 'Vestima+ is an automated order-routing service that offers a single point of access to order issuers for in-house domestic, third-party, cross-border and off-shore funds.'),
(30, 1, '2017-01-16 09:10:10', '2017-01-16 09:10:10', 8, 4, 4, 4, 4, 'CASCADE RS', NULL, 'AID042', '', 'Processing of RegisteredShares in CSC business', 'CASCADE-RS includes all functions related to the processing of Registered Shares in CSC business.'),
